import React from 'react';
import {Button, Container, Grid, Paper, Typography} from "@material-ui/core";
import {createMuiTheme, makeStyles, ThemeProvider} from '@material-ui/core/styles';
import './Product.scss';
import CardMedia from "@material-ui/core/CardMedia";

const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#5ee279',
            main: '#1aaf4b',
            dark: '#007e1d',
            contrastText: '#444',
        },
        secondary: {
            main: '#1bb14c',
        },
    },

});
const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1
    },
    productWrap: {
        height: 'auto'
    },
    heroArea: {
        minHeight: '400px',
    },
    productsArea: {
        backgroundColor: '#eee',
        height: 400,
        paddingTop: '50px',
    },
    productItem:{
        height: '100%',
        paddingTop: '5%'
    },
    infoArea: {
        height: 400,
        backgroundColor: '#F7F7F7',

    },
    paysArea: {
        height: 400
    },
    title:{
        margin:'120px 50px 80px 50px',
    },
    desc:{
        margin:'0 100px',
        textAlign:'center'
    },
    productDesc:{
        textAlign:'left'
    },
    submit: {
        margin: theme.spacing(3, 0, 2),
    },

}));


export default function Product() {
    const classes = useStyles();

    return (
        <div className={classes.productWrap}>
            <ThemeProvider theme={theme}>
            <div className={classes.heroArea}>
                <Container maxWidth='md'>
                    <Typography variant="h4" align="center" className={classes.title}>DV Bank ONLINE <br/>Checking Accounts</Typography>
                    <Typography variant="body2" className={classes.desc}>
                        Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been
                        the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley
                        of type and scrambled it to make a type specimen book. It has survived not only five centuries,
                        but also the leap into electronic typesetting, remaining essentially unchanged. It was
                        popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages,
                        and more recently with desktop publishing software like Aldus PageMaker including versions of
                        Lorem Ipsum.
                    </Typography>
                </Container>
            </div>
            <div className={classes.productsArea}>
                <Container>
                    <Grid container spacing={3} className={classes.productItem}>
                        <Grid item xs>
                            <Paper>
                                <CardMedia
                                    image="https://i.picsum.photos/id/6/300/200.jpg"
                                    title="Contemplative Reptile"
                                />
                            </Paper>
                        </Grid>
                        <Grid item xs>
                            <Typography variant="body2" className={classes.productDesc}>
                                Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been
                                the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley
                                of type and scrambled it to make a type specimen book. It has survived not only five centuries,
                                but also the leap into electronic typesetting, remaining essentially unchanged. It was
                                popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages,
                                and more recently with desktop publishing software like Aldus PageMaker including versions of
                                Lorem Ipsum.
                            </Typography>
                            <Button
                                type="submit"
                                fullWidth
                                variant="contained"
                                color="primary"
                                className={classes.submit}
                            >
                                Get Started
                            </Button>
                        </Grid>
                    </Grid>
                </Container>
            </div>
            <div className={classes.infoArea}>
                <Container>
                    <Typography variant="subtitle2">
                        Product Information
                    </Typography>
                    <Grid container spacing={3}>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                    </Grid>
                </Container>
            </div>
            <div className={classes.paysArea}>
                <Container>

                </Container>
            </div>
            </ThemeProvider>
        </div>
    );
}
